import React, {Component} from "react";

import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
import Card from "react-bootstrap/Card";


const data = [
    {name: 'Jan', uv: 960, pv: 1200, amt: 2400},
    {name: 'Feb', uv: 1168, pv: 1400, amt: 2400},
    {name: 'Mar', uv: 640, pv: 800, amt: 2400},
    {name: 'Apr', uv: 1680, pv: 2100, amt: 2400},
    {name: 'May', uv: 450, pv: 560, amt: 2400},
    {name: 'Jun', uv: 2080, pv: 2600, amt: 2400}
            ];

const renderLineChart = (
    <LineChart width={650} height={300} data={data} style={{margin: "1%"}}>
        <XAxis dataKey="name"/>
        <YAxis/>
        <CartesianGrid stroke="#eee" strokeDasharray="5 5"/>
        <Line type="monotone" dataKey="uv" stroke="#8884d8" />
        <Line type="monotone" dataKey="pv" stroke="#82ca9d" />
        <Tooltip />
    </LineChart>
);



class Main_Card_Graph extends Component{
    render() {
        return(
            <Card className="mx-3">
                <h2 style={{margin: "3%"}}>Satistiques des revenues</h2>
                {renderLineChart}
            </Card>
        );
    }
}

export default Main_Card_Graph;
